(function(){var loadHandler=window['sl_{C88E5A5D-C781-47D6-8838-56CAB61ADDF8}'];loadHandler&&loadHandler(18, '<div id="spr0_1fcf01"><div id="spr1_1fcf01" class="kern slide"><img id="img1_1fcf01" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/></div><div id="spr2_1fcf01" class="kern slide"><div id="spr3_1fcf01"><div id="spr4_1fcf01"><img id="img0_1fcf01" src="data:image/png;base64," width="1279.5" height="720.75" alt="" style="left:0.188px;top:-0.281px;"/></div></div><div id="spr5_1fcf01" style="left:547.326px;top:76.286px;"><div style="width:0px;"><span id="txt0_1fcf01" data-width="395.392029" style="left:9.6px;top:40.142px;">Fear Network Model</span></div></div><div id="spr6_1fcf01" style="left:547.326px;top:229.588px;"><div style="width:0px;"><span id="txt1_1fcf01" class="nokern relpos" dir="auto" style="left:9.6px;top:2.664px;">•</span> <span id="txt2_1fcf01" class="relpos" data-width="483.978699" style="left:26.131px;top:-1.141px;">Strong memory connections are formed because of</span></div><div style="width:0px;"><span id="txt3_1fcf01" data-width="503.269348" style="left:33.6px;top:21.899px;">hyperarousal of the fear and safety centers in the brain</span></div><div style="width:0px;"><span id="txt4_1fcf01" class="nokern relpos" dir="auto" style="left:9.6px;top:84.32px;">•</span> <span id="txt5_1fcf01" class="relpos" data-width="546.453369" style="left:26.131px;top:80.515px;">The traumatic event violates basic beliefs of personal safety</span></div><div style="width:0px;"><span id="txt6_1fcf01" class="nokern relpos" dir="auto" style="left:9.6px;top:143.733px;">•</span> <span id="txt7_1fcf01" class="relpos" data-width="572.298645" style="left:26.131px;top:139.928px;">There are strengthened memory associations made between</span></div><div style="width:0px;"><span id="txt8_1fcf01" data-width="515.680054" style="left:33.6px;top:163.766px;">the experience/stimuli (smells, sounds, sights, sensations,</span></div><div style="width:0px;"><span id="txt9_1fcf01" data-width="582.645386" style="left:33.6px;top:186.806px;">perceptions) related to the trauma that then comprise “the fear</span></div><div style="width:0px;"><span id="txt10_1fcf01" data-width="186.581345" style="left:33.6px;top:209.846px;">network” in the brain</span></div><div style="width:0px;"><span id="txt11_1fcf01" class="nokern relpos" dir="auto" style="left:9.6px;top:272.267px;">•</span> <span id="txt12_1fcf01" class="relpos" data-width="510.373230" style="left:26.131px;top:268.461px;">When the network is reactivated by a trigger, the person</span></div><div style="width:0px;"><span id="txt13_1fcf01" data-width="575.872070" style="left:33.6px;top:292.299px;">becomes hypervigilant (arousal), information from the network</span></div><div style="width:0px;"><span id="txt14_1fcf01" data-width="549.525391" style="left:33.6px;top:315.339px;">enters consciousness (intrusion symptoms), and the person</span></div><div style="width:0px;"><span id="txt15_1fcf01" class="relpos" data-width="534.053406" style="left:33.6px;top:338.541px;">attempts to avoid and suppress the intrusions (avoidance</span> <span id="txt16_1fcf01" class="relpos" style="left:33.593px;top:338.541px;">)</span></div></div><div id="spr7_1fcf01" style="left:963.429px;top:665.81px;"><div style="width:0px;"><span id="txt17_1fcf01" data-width="15.200000" style="left:263.1px;top:6.687px;">19</span></div></div></div></div>', '{"s":[]}');})();